@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM a owl:Class .
atm:Card a owl:Class .
atm:BankComputer a owl:Class .
atm:Request a owl:Class .
atm:Response a owl:Class .
atm:ErrorMessage a owl:Class .

atm:hasCard a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Card .

atm:sendsRequest a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Request .

atm:receivesResponse a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Response .

atm:rejectsCard a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Card .

atm:displaysMessage a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:ErrorMessage .

atm:responseTime a owl:DatatypeProperty ;
  rdfs:domain atm:Response ;
  rdfs:range xsd:duration .

atm:hasErrorMessage a owl:DatatypeProperty ;
  rdfs:domain atm:ErrorMessage ;
  rdfs:range xsd:string .
